package com.class9;

public class MultiplicationTable {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int result;
		
		for (int a=1; a<=10; a++) {
             for (int b=1; b<=10; b++) {
				result=a*b;
				System.out.println(a+"*"+b+"="+result);
		}
			
		}
		

	}

}
